--
-- Name: ensure_single_default_template(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.ensure_single_default_template() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    -- If setting this template as default, unset all others in the org
    IF NEW.is_default = TRUE THEN
        UPDATE column_mapping_templates
        SET is_default = FALSE
        WHERE organization_id = NEW.organization_id
          AND id != NEW.id
          AND is_default = TRUE;
    END IF;
    RETURN NEW;
END;
$$;


--
-- Name: generate_slug_from_name(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.generate_slug_from_name() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    -- Only generate slug if it's NULL or empty
    IF NEW.slug IS NULL OR NEW.slug = '' THEN
        NEW.slug := lower(
            regexp_replace(
                regexp_replace(
                    regexp_replace(trim(NEW.name), '[^\w\s-]', '', 'g'),  -- Remove special chars
                    '\s+', '-', 'g'                                        -- Replace spaces with hyphens
                ),
                '-+', '-', 'g'                                             -- Replace multiple hyphens with single
            )
        );
    END IF;
    RETURN NEW;
END;
$$;


