CREATE FUNCTION public.get_active_cns_config(p_tenant_id character varying) RETURNS TABLE(id integer, tenant_id character varying, config_name character varying, is_active boolean, is_global boolean, enable_suppliers boolean, preferred_suppliers text[], supplier_min_confidence numeric, enable_ai boolean, ai_provider character varying, ai_operations text[], ai_min_confidence numeric, ai_cost_limit_monthly numeric, enable_web_scraping boolean, scraping_sources text[], scraping_timeout_seconds integer, quality_reject_threshold integer, quality_staging_threshold integer, quality_auto_approve_threshold integer, batch_size integer, max_retries integer, ai_cost_current_month numeric, ai_requests_current_month integer, web_scraping_requests_current_month integer, created_at timestamp without time zone, updated_at timestamp without time zone)
    LANGUAGE plpgsql
    AS $$
BEGIN
    -- Try tenant-specific config first
    IF p_tenant_id IS NOT NULL THEN
        RETURN QUERY
        SELECT c.* FROM cns_enrichment_config c
        WHERE c.tenant_id = p_tenant_id AND c.is_active = TRUE
        LIMIT 1;

        IF FOUND THEN
            RETURN;
        END IF;
    END IF;

    -- Fallback to global config
    RETURN QUERY
    SELECT c.* FROM cns_enrichment_config c
    WHERE c.is_global = TRUE AND c.is_active = TRUE
    ORDER BY c.created_at DESC
    LIMIT 1;
END;
$$;


