--

CREATE VIEW public.cns_events_retention_summary AS
 SELECT cns_processing_events.organization_id,
    cns_processing_events.event_category,
    cns_processing_events.severity,
    date_trunc('day'::text, cns_processing_events.created_at) AS event_date,
    count(*) AS event_count
   FROM public.cns_processing_events
  GROUP BY cns_processing_events.organization_id, cns_processing_events.event_category, cns_processing_events.severity, (date_trunc('day'::text, cns_processing_events.created_at))
  ORDER BY (date_trunc('day'::text, cns_processing_events.created_at)) DESC;


