--

CREATE VIEW public.components_needing_review AS
 SELECT eq.id,
    eq.mpn,
    (eq.enrichment_data ->> 'description'::text) AS description,
    eq.quality_score,
    eq.enrichment_source,
    eq.status,
    eq.created_at,
    COALESCE(jsonb_array_length(eq.issues), 0) AS issue_count,
    COALESCE(jsonb_array_length(eq.ai_suggestions), 0) AS suggestion_count
   FROM public.enrichment_queue eq
  WHERE ((eq.status)::text = 'needs_review'::text)
  ORDER BY eq.quality_score DESC, eq.created_at;


