--
-- Name: role_mappings; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.role_mappings AS
 SELECT 'super_admin'::text AS canonical_role,
    5 AS level,
    'Platform super admin - full access across all tenants'::text AS description,
    ARRAY['super_admin'::text, 'platform:super_admin'::text, 'platform-super-admin'::text, 'realm-admin'::text, 'platform_admin'::text] AS aliases
UNION ALL
 SELECT 'owner'::text AS canonical_role,
    4 AS level,
    'Organization owner - billing, delete org'::text AS description,
    ARRAY['owner'::text, 'org-owner'::text, 'organization-owner'::text, 'billing_admin'::text] AS aliases
UNION ALL
 SELECT 'admin'::text AS canonical_role,
    3 AS level,
    'Organization admin - user management, settings'::text AS description,
    ARRAY['admin'::text, 'administrator'::text, 'org_admin'::text, 'tenant-admin'::text, 'org-admin'::text] AS aliases
UNION ALL
 SELECT 'engineer'::text AS canonical_role,
    2 AS level,
    'Engineer - manage BOMs, components, specs'::text AS description,
    ARRAY['engineer'::text, 'staff'::text, 'developer'::text, 'support'::text, 'operator'::text, 'platform:engineer'::text, 'platform:staff'::text] AS aliases
UNION ALL
 SELECT 'analyst'::text AS canonical_role,
    1 AS level,
    'Analyst - read-only access, reports'::text AS description,
    ARRAY['analyst'::text, 'user'::text, 'customer'::text, 'viewer'::text, 'member'::text, 'read-only'::text] AS aliases;


