--
-- Name: user_profiles; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.user_profiles AS
 SELECT users.id,
    users.organization_id,
    users.email,
    users.first_name,
    users.last_name,
    users.full_name,
    COALESCE(users.role, 'analyst'::text) AS role,
    NULL::text AS job_title,
    COALESCE(users.is_active, true) AS is_active,
    users.is_platform_admin AS is_staff,
    users.is_platform_admin AS platform_admin,
    COALESCE(users.email_verified, true) AS email_verified,
        CASE
            WHEN (users.keycloak_user_id IS NOT NULL) THEN 'keycloak'::text
            WHEN (users.auth0_user_id IS NOT NULL) THEN 'auth0'::text
            ELSE 'local'::text
        END AS auth_provider,
    COALESCE(users.keycloak_user_id, users.auth0_user_id) AS auth_subject,
    users.last_login_at,
    users.metadata,
    users.created_at,
    users.updated_at
   FROM public.users;


